import React, { Fragment } from "react";
import style from "./Header.module.css";
import headerImg from "../../assets/header-food.jpg";

const Header = () => {
  return (
    <Fragment>
      <div className={style["main-image"]}>
        <img src={headerImg} alt="header-food-img" />
      </div>
    </Fragment>
  );
};

export default Header;
